import React from 'react';
import './App.css';
import {BrowserRouter, Route } from "react-router-dom";
import Teacher from './components/Teacher/Teacher'
import Student from './components/Student/Student';

function App() {
  return (
    <BrowserRouter>
      <Route path="/" render={()=><Home/>} >Sik</Route>
      <Route path="teacher" render={()=><Teacher/>}> </Route>
      <Route path="student" render={()=><Student/>}></Route>
      <Student/>
    </BrowserRouter>
  );
}




export default App;
